import {useState, useEffect} from "react";
import {useParams} from "react-router-dom";

function MovieVideo() {
  const [movieState, setMovie] = useState([]);
  const {id} = useParams();
  console.log(id);

  useEffect(() => {
    fetch(
      `http://api.themoviedb.org/3/movie/${id}/videos?api_key=131f3dc4657440aa2ed80c0a22a7d1f9`
    )
      .then((res) => res.json())
      .then((res) => {
        setMovie(res.data);
      })
      .catch((err) => {});
  }, []);
  console.log(movieState);
  return (
    <div>
      {movieState.map((value) => (
        <div>{console.log(value.results)}</div>
      ))}
    </div>
  );
}

export default MovieVideo;
